import React,{Component} from 'react-dom';
import "./App.css";
import Header from './components/Header';


class Bill extends  Component{
    render()
    {
        return(
            <div className="app">
                <div style={mainStyle}>
                    <Header/>
                </div>
            </div>
        );
    }
}

const mainStyle={
    padding:'10px',
    position: 'absolute',
    left:'100px',
    right:'220px',
    top: '100px',
    bottom: '10px'
};

export default Bill;
